import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import "./headerCard.css"

class HeaderCard extends Component {
    render() {
        return (
            <Container fluid>
                <Row size="my-3">
                    <Col>
                        <img id="logoEsogu" src="esogu-logo.png" />
                    </Col>
                    <Col className="my-4">
                        <span class="bold header">Eskişehir Osmangazi Üniversitesi</span>
                        <br />
                        Öğrenci Yönetim Sistemi
                    </Col>
                    <Col className="closeApp">
                        <div className="m-0">Merhaba, John Doe</div>
                        <div><Button variant="secondary">Çıkış Yap</Button></div>
                    </Col>
                </Row>
            </Container >
        )
    }
}

export default HeaderCard;
